import React from 'react';
import WhatsApp from './components/whatsap';

const App = () => {
  return (
    <div className="App">
      <h1>Welcome to Our Website</h1>
      <WhatsApp 
        phoneNumber="0773491110" 
        message="Hello! thanks ." 
      />
    </div>
  );
};

export default App;
